import React from "react";
import LibraryIteration from "./LibraryIteration";

export default function Library(props) {
  return (
    <table>
      <th>
        <tc>Serial Number</tc>
        <tc>Name</tc>
        <tc>Author</tc>
        <tc>Genre</tc>
        <tc>Pirate Link</tc>
      </th>
      <LibraryIteration bookList = {props.bookList}/>
    </table>
  );
}
